import CompLi from "./components/CompLi";
import CompResult from "./components/CompResult";
import CompUl from "./components/CompUl";

function App() {
  return (
    <>
      <h1>context</h1>
      <hr />
      <CompUl />
      <CompResult/>
      <hr />
    </>
  );
}

export default App;
